function createRoute(){var e="api.route.php",o=$("#caliber_id").val(),r=$("#code").val(),a=$("#code").val(),t=$("#description").val();$.ajax({url:e,cache:!1,dataType:"json",type:"POST",data:{calling:"route",action:"create_route",caliber_id:o,code:r,name:a,description:t},error:function(){console.log("Request Error")}}).done(function(e){console.log("Return: "+e.message)}).error()}function editRoute(){var e="api.route.php",o=$("#route_id").val(),r=$("#code").val(),a=$("#name").val(),t=$("#description").val();$.ajax({url:e,cache:!1,dataType:"json",type:"POST",data:{calling:"route",action:"edit_route",route_id:o,code:r,name:a,description:t},error:function(){console.log("Request Error")}}).done(function(e){console.log("Return: "+e.message)}).error()}function deleteRoute(e){var o="api.route.php",r=$("#caliber_id").val();$.ajax({url:o,cache:!1,dataType:"json",type:"POST",data:{calling:"route",action:"delete_route",route_id:e},error:function(){console.log("Request Error")}}).done(function(e){console.log("Return: "+e.message),window.location="route.php?caliber="+r}).error()}